window.bookSummaryJSON = "<p>A fighter pilot on a mission to reunite with her daughter. A cyborg soldier on a quest to regain his humanity. </p> <p>Mortal enemies during the war, they must now work together to salvage a 70-year-old freighter and navigate the gauntlet of pirates, scavengers, mercenaries, and other pitfalls that stand in their way after the fall of the largest empire mankind has ever known. </p> <p>This omnibus includes <i>Star Nomad</i> (Book One), <i>Honor's Flight</i> (Book Two), <i>Starseers </i>(Book Three), as well as the short story, \"Starfall Station\". </p> <p>Star Nomad was a nominee for the Goodreads Readers' Choice Awards and also made Amazon's Top 20 list of Best Science Fiction and Fantasy of 2016. Start the adventure now! </p>"; 
